import React from "react";
import GameItem from "./GameItem/GameItem"; // Updated import to reflect the change from EventItem to GameItem
import "./EventList.css";

const GameList = ({ events, authUserId, onViewDetail }) => {
  const games = events.map((game) => (
    <GameItem
      key={game._id}
      eventId={game._id}
      title={game.title}
      price={game.price}
      date={game.date}
      userId={authUserId}
      creatorId={game.creator._id}
      onDetail={onViewDetail}
    />
  ));

  return <ul className="games__list">{games}</ul>; // Updated className to reflect change
};

export default GameList;
